import React from "react";
import { Link } from "react-router-dom";
import githubIcon from "../Images/github-logo.png"
import linkedinIcon from "../Images/linkedin-logo.png"

const Footer = () => {
  return (
    <footer className="bg-[#7F3DFF] text-white py-10 ">
    <div className="flex flex-col justify-between items-center">

      <h4>ʛalleon</h4>
      <p>created by </p>
      <div className="flex">
        <div className="flex">
          <p>Ece Çakmak </p>
          <Link to="https://github.com/ececmk"><img className=" w-6  h-6" src={githubIcon} alt="Github" /></Link>
          <Link to="https://www.linkedin.com/in/ececmk/"><img className=" w-6  h-6" src={linkedinIcon} alt="Linkedin" /></Link>
        </div>
        <p> & </p>
        <div className="flex">
          <p>Christian Schuermann</p>
          <img className=" w-6  h-6" src={githubIcon} alt="Github" />
          <img className=" w-6  h-6" src={linkedinIcon} alt="Linkedin" />
        </div>
      </div>
      <p>© 2022 Galleon. All rights reserved.</p>

    </div>
    </footer>
  );
};

export default Footer;
